.candidateTable_victor {
  padding-right: 6px;
  vertical-align: middle;
  display: inline;
  opacity: 0;
}
.candidateTable_displayVictor {
  opacity: 1;
}

.candidateTable_name,
.candidateTable_shortName {
  color: #000;
  vertical-align: middle;
}

.candidateTable_party,
.candidateTable_shortParty {
  color: #000;
}
